        "Quotes": ""SMB Relay attacks involve relaying SMB connections between compromised hosts and target systems to gain unauthorized access, escalate privileges, or move laterally within a network. The rule matches specific patterns indicative of SMB Relay attacks, including the presence of a Responder poisoner and a malicious server, which are key components of this technique."",
        "Explanation": "This event is generated when activity relating to an SMB Relay attack is detected."
    },
    {
        "sid": "50106",
        "Technique ID": "T1059",
        "Technique name": "Command and Control",
        "Quotes": ""Command and Control (C2) techniques involve establishing and maintaining communication channels with remote adversaries to facilitate remote control and management of compromised systems. Responder poisoner attacks often involve the establishment of covert C2 channels, which use SMB as a communication mechanism to control infected hosts and establish persistence within the target network."",
        "Explanation": "This event is generated when activity relating to a C2 attack is detected."
    }
]'}

